import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import Icon from '@material-ui/core/Icon';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import ButtonPlusClient from './ButtonPlusClient';
const useStyles = makeStyles({
  root: {
    width: '100%',
    position:'absolute',
    bottom:'0'

  },
});

export default function LabelBottomNavigation() {
  const classes = useStyles();
  const [value, setValue] = React.useState('recents');

  function handleChange(event, newValue) {
    setValue(newValue);
  }

  return (
    <BottomNavigation value={value} onChange={handleChange} className={classes.root}>
      <ButtonPlusClient />
      <BottomNavigationAction label="Notifications" value="recents" icon={<RestoreIcon />} />
      <BottomNavigationAction label="Client" value="favorites" icon={<FavoriteIcon />} />
      <BottomNavigationAction label="Reservation" value="nearby" icon={<LocationOnIcon />} />
      <BottomNavigationAction label="Historique" value="historique"><ButtonPlusClient /></BottomNavigationAction>
    </BottomNavigation>
  );
}
